import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {Provider} from 'react-redux';
import store from './store';

ReactDOM.render(<Provider store={store}>{console.log("Store ",store)}<App /></Provider>,document.getElementById('root'));
